define(['./map'], function (map) {

    /**
     * Extract a list of property values.
     */
    /**
     * Description
     * @method pluck
     * @param {} arr
     * @param {} propName
     * @return CallExpression
     */
    function pluck(arr, propName){
        return map(arr, propName);
    }

    return pluck;

});
